import "./Post.scss";

function Post() {
    return (
        <div className="post">
            <div className="top">
                <div className="avatar-container">
                    <img className="avatar" alt="profile-picture"></img>
                </div>
                <div className="username">
                    vefa.ozlu
                </div>
                <MoreIcon />
            </div>
            <div className="content-container">
                <img className="content" alt="post"></img>
            </div>
            <div className="buttons-container">

            </div>
        </div>
    );
}

const MoreIcon = () => {
    return (
        <svg fill="white">
            <circle cx="12" cy="12" r="1.5"></circle>
            <circle cx="6" cy="12" r="1.5"></circle>
            <circle cx="18" cy="12" r="1.5"></circle>
        </svg>
    );
};

export default Post;
